definitions.definition:
The active principle of the water hemlock (
            Cicuta
         ) extracted as a poisonous gummy substance.

a genus of anaerobic, spore-forming motile bacteria of the family Bacillaceae, including several pathogenic species, such as the causative agents of gas gangrene

               Clostridium perfringens
            ), botulism

               Clostridium botulinum
            ), and tetanus

               Clostridium tetani
            ).
